import React, { Component } from 'react';
import ButtonTrend from './ButtonTrend.js'
import styles from './ButtonTrend.module.css';

class Container extends Component {

  render() {
    return (
      <div className="Container">
        <ButtonTrend {...props}/>
      </div>
    );
  }
}

export default Container;
